import { Box } from "@chakra-ui/react";
import { HamburgerIcon } from "@chakra-ui/icons";

const Nav = () => {
	return (
		<Box as="header" bg="rgb(32, 35, 38)">
			<Box as="nav">
				<HamburgerIcon color="white.500" />
			</Box>
		</Box>
	);
};

export default Nav;
